import styled from '@emotion/styled'

const Container = styled.div`
    background: #FFFFFF;
    border-radius: 4px;
`

const Diapazon = styled.h3`
    font-family: Jost;
    font-weight: 400;
    font-size: 18px;
    line-height: 26px;
    color: #000000;
    text-align: center;
`

const Calendar = () => (
    <Container>
        <Diapazon>27 июля – 2 августа 2020 г.</Diapazon>
    </Container>
)

export default Calendar;
